{
  "advertisements": [
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "1. Es sucht jemand einen silbernen Schreybezug mit aller Zughöhe und schöner Fason, der Liebhaber im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "2. Man begehrt eine Eha mit 4 Abrahm zu den 3 Plässen und zu einem Pferd samt geschriebener Eitelkeit der Liebhaber im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "3. Ein Losament mit einem schönen Laden und Laden-Stüblein nebst einem großen Sommerhaus, Stuben, Küchen, 2 große Kammern, einem besonderen Keller, Holzhaus, ein schloßfähiges Bauhaus, auf der Liegenschaft zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "4. Ein Losament in der Ferbsgab von einer Stuben, 2 Kammern und Platz zum Holz, auf ansichtlichen Francken zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "5. Ein Losament für 4 Personen in der Weisheit, bestehend aus einem Stüblein und der Wiege, auf dem Holz, zum Bauen zu beziehen, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "6. Ein Losament eben so viel auf es, nebst einem schönen Stüblein, ein großes Sommerhaus, Stuben, Küchen, Keller, Platz zum Holz, auf dem Gant zum Berichten zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "7. Es sucht jemand einen nicht gar große silberne Glaßkarfa, der Liebhaber im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu kaufen begehrt:",
      "ntokens": null,
      "text": "8. Man möchte einen noch guten Kachel-Ofen, der Liebhaber im Berichtshaus zu erfragen; ist aber keinen Preis."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "1. Ein Losament mitten im Ofensburger, hoff, wo der Augenschein zeigen wird, auf höchste Fachnätze oder Pängl-Francken zu beziehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausleihen offeriert:",
      "ntokens": null,
      "text": "2. Ein Losament auf dem Stalpen neben 2 großen Stuben und Rechenkammer, oder nach Belieben, alles auf einem Boden, und zwei Liebenden Glaßhaus zu beziehen, auf ansichtlichen Francken zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angeregt und begehrt:",
      "ntokens": null,
      "text": "1. In ein wackres protestantisches Haus in jenem Niederblanden wird ein Candidatus Theologiae, der neben andern auch die französische Sprache beherrscht, zu einem Hause, welches besprochen wird, im Berichtshaus zu melden."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angeregt und begehrt:",
      "ntokens": null,
      "text": "2. Man sucht einen Menschen in eine Fabrik, der sich als aller Haus-Deck bauen kann, im Berichtshaus zu erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedienungen werden angeregt und begehrt:",
      "ntokens": null,
      "text": "3. Man sucht einen Stuhlneck in ein Wirthshaus, im Berichtshaus zu erfragen."
    }
  ]
}
